import React from 'react';
import { Link }from 'react-router-dom';

export default function TvShow(props) {
    return (

        <Link to="/details" className='item'><img src={props.image} alt={`${props.name}`} />
            <div className='overlay'>
                <h2>{props.name}</h2>
            </div>
        </Link>

    );

}
